const HomePage = () =>
{
    return(
        <div>
            <div style={{marginTop: '20px', display: 'flex', alignItems: 'center', gap: '20px'}}>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
                <CardComponent/>
            </div>
            <div>
                <ButtonComponent
                textbutton= "Xem them" type="outline" styleButton={{border: '1px solid rgb(11,116,229', color}}/>
            </div>
            <div>
                <NavbarComponent/>
            </div>
        </div>
        
    )
}

export default HomePage;
